import React from 'react';
import Container from '@material-ui/core/Container';
import Img from '../../img/admin.webp';
import {BrowserRouter as Router, Route, Switch,Redirect} from 'react-router-dom';
import Usuarios from '../../menu_usuarios/usuarios'

import './img.css';

const redirigir = () =>{
  console.log('Redirigiendo')
  return(
    <Router>
    <Switch>
      <Route path="/inicio" render={(routerProps) =><Usuarios {...routerProps} ></Usuarios>}/>
      <Redirect from="*" to="/inicio"/>
    </Switch>
  </Router>
  );
}

const Bienvenida = () =>{
    return(
   <React.Fragment>
       <h1 style={{textAlign:'center'}}>Bienvenido</h1>
   <Container maxWidth="sm">
     <section className="im" style={{ backgroundImage:"url("+Img+")",backgroundSize:'cover', height: '100vh' }} >
       <button onClick={redirigir} >comenzar</button>
     </section>
   </Container>
 </React.Fragment>
    );
}

export default Bienvenida;
